import React from 'react';
import Card from './Card';

const CardList=({Profile})=>{
   CardComponent=Profile.map((students,i)=>{
<Card id={Profile[0].id} name={Profile[0].name} email={Profile[0].email}/>
   });

    return(
    <div>
    <Card id={Profile[0].id} name={Profile[0].name} email={Profile[0].email}/>
    <Card id={Profile[1].id} name={Profile[1].name} email={Profile[1].email}/>
    <Card id={Profile[2].id} name={Profile[2].name} email={Profile[2].email}/>
    <Card id={Profile[3].id} name={Profile[3].name} email={Profile[3].email}/>
    </div>
    );
}
export default CardList;
